import React from 'react'
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import IconButton from "@material-ui/core/IconButton";
import Typography from "@material-ui/core/Typography";
import { AccessTime, AccountBox, CenterFocusStrong, MoreHoriz } from "@material-ui/icons";
import img1 from './img1.png';
import {Link} from 'react-router-dom';
import { Grid } from '@material-ui/core';



function BookCard() {

    const styles={
        image:{
            width:"100%",
            height:"100%"


        },
        justify:{
            float:"center",
            textAlign:"center",
        },
        cards:{
            width:"20%",
            height:"65%"

        },
        div_image:{
            padding:10,

            height:"60%",
            backgroundColor:"black",
        }
        ,
        horiz:{
            float:"right",
        }
    }




  return (
    <Card style={styles.cards}>


        <div style={styles.div_image}>

        <img style={styles.image} alt=" " src={img1}></img>

        </div>
        <Grid container>
        <Grid style={{height:"50%"}}>

            <Typography  style={styles.justify} >
                <b>HARRY POTTER ALSo NEW SEASON JUYT </b>
            </Typography>

            <Typography noWrap={true} component="p">
                Vivek Reddy S
            </Typography>




            <IconButton >
                <AccessTime />
            </IconButton>
            15 min to read
            <IconButton>
                <AccountBox />
            </IconButton>
            15.6k feed
        <CardActions style={styles.horiz}>

            <IconButton>
                <Link to="/book">
                <MoreHoriz />
                </Link>

            </IconButton>

        </CardActions>

       </Grid>
        </Grid>
    </Card>
  );
}

export default BookCard
